import React from 'react';
import "../Hero/Hero.css";

function Hero() {
    return (
        <>
            <div className="hero-section">
                <div className='row  mt-5 w-50 mx-auto'>
                    <div className='col-md-8 d-flex'>
                        <input class="form-control m-2" type="text" placeholder='Select category'/>
                        <input class="form-control m-2" type="text" placeholder='Enter City'/>
                        <button className='btn btn-dark m-2 p-2'>Search</button>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Hero;
